import React from "react";
import PropTypes from "prop-types";

import { Avatar, Div, Panel, PanelHeader } from "@vkontakte/vkui";

const Home = ({ id, groups }) => (
  <Panel id={id}>
    <PanelHeader>Example</PanelHeader>
    {console.log(groups)}
    {groups.length > 0
      ? <div>Вы являетесь представителем:</div> |
        groups.map((group) => (
          <Avatar size={100} src={group.photo_100} key="1" />
        ))
      : ""}
  </Panel>
);

Home.propTypes = {
  id: PropTypes.string.isRequired,
};

export default Home;
